import React from 'react'

const Gallery = () => {
  return (

function Leaderboard() {
  const [winners, setWinners] = useState([]);

  useEffect(() => {
    // Fetch winners data from API or database
    const fetchWinnersData = async () => {
      try {
        const response = await fetch('/api/winners');
        const data = await response.json();
        setWinners(data);
      } catch (error) {
        console.error(error);
      }
    };

    fetchWinnersData();
  }, []);

  return (
    <div>
      <h2>Leaderboard of Winners</h2>
      <table>
        <thead>
          <tr>
            <th>Rank</th>
            <th>Name</th>
            <th>Score</th>
          </tr>
        </thead>
        <tbody>
          {winners.map((winner, index) => (
            <tr key={winner.id}>
              <td>{index + 1}</td>
              <td>{winner.name}</td>
              <td>{winner.score}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

  )
}

export default Gallery
